0,8,13,18,2,15,'8:43','','Not reviewed','1','2020-12-07 01:16:16','2020-12-07 01:16:16',1,0),(41,11,17,40,2,15,'9:13','Tapped him in the back causing spin and lose 7 places','Not reviewed','1','2020-12-07 04:03:51','2020-12-07 04:03:51',1,0),(43,58,12,1,3,14,'5:03','Re-Report of incident with correct penalty. Contact made with #888 Griffal in the spin.','Independent review notes posted to discord.','4','2020-12-07 16:45:26','2020-12-15 20:03:53',0,1),(44,12,58,1,3,14,'5:03','Inverse of another report, awaiting results.','Independent review notes posted to discord.','3','2020-12-07 16:48:38','2020-12-15 20:04:14',1,1),(45,12,16,1,1,14,'5:09','','No contact was made, penalty was applied and manually reversed. -Dale','5','2020-12-07 16:49:16','2020-12-15 20:18:34',1,1),(46,12,18,1,1,14,'5:09','','Miles with car facing backwards on track, clipped car not waiting for a safe time to continue.','3','2020-12-07 16:49:47','2020-12-07 16:52:49',1,1),(47,13,12,1,2,14,'107:35','','Miles had the right to the inside line, McVeigh turned in knocking Miles off track.','3','2020-12-07 16:50:18','2020-12-07 16:51:28',1,0),(48,27,40,18,2,15,'6:49','','Not reviewed','1','2020-12-07 21:29:50','2020-12-11 19:19:37',1,1),(49,27,40,18,2,15,'10:32','','Not reviewed','1','2020-12-07 21:30:37','2020-12-11 19:19:44',1,0),(50,28,0,1,5,16,'','','Not reviewed','3','2020-12-14 01:10:54','2020-12-14 01:11:19',1,0),(51,28,70,1,3,16,'5:58','Turn in on Fernandes causing a massive chain reaction of incidents.','Not reviewed','3','2020-12-14 01:23:46','2020-12-14 01:24:06',1,1),(52,3,9,1,1,16,'25:52','','Not reviewed','3','2020-12-14 01:31:34','2020-12-14 01:31:43',1,0),(53,70,34,1,2,16,'14:30','','Not reviewed','3','2020-12-14 01:35:21','2020-12-14 01:35:31',1,0),(54,1,23,1,2,16,'23:11','','Not reviewed','3','2020-12-14 01:39:06','2020-12-14 01:39:16',1,0),(55,28,70,1,2,16,'36:00','','Not reviewed','3','2020-12-14 01:46:06','2020-12-14 01:46:20',1,0),(56,26,23,1,2,16,'39:42','','Not reviewed','1','2020-12-14 01:48:08','2020-12-14 01:51:13',1,0),(57,5,0,1,2,16,'52:50','','Hans was Victim.','1','2020-12-14 01:50:38','2020-12-14 01:56:25',1,0),(58,12,9,1,1,16,'63:26','','Not reviewed','3','2020-12-14 01:54:00','2020-12-14 01:54:12',1,0),(59,14,67,45,2,16,'5:50-6:00','I passed #156 on the inside going into the last chicane and he tried to fight back and go two wide through the chicane. He ended up hitting my rear left quarter panel on the left turn of the chicane. His number does not show in the incident chart but that is what caused the 3 car crash.','Not reviewed','2','2020-12-14 02:21:17','2020-12-14 20:01:52',0,1),(60,9,67,23,3,18,'15:18','','Not reviewed','1','2021-01-18 01:45:29','2021-01-18 01:45:29',1,0),(61,10,22,24,2,18,'34:42','Dale got better drive through 130R expected him to go on the inside to take the chicane but he didn\'t and hit/spun me','Not reviewed','1','2021-01-18 03:30:36','2021-01-18 21:34:37',1,0),(62,10,39,3,3,18,'44:30','Ethan slowed down to let Dale past on the exit of T2, Dale unluckily lost control and ended up hitting Ethan, spinning him into Gary.','Not reviewed','3','2021-01-20 02:16:39','2021-01-20 15:24:21',1,0),(63,76,10,3,1,18,'5:16','Raz brakes a little too little a little too late into T1 and went too far on the inside, tires went into the grass causing the car to rotate left into Dale. No positions lost luckily but could have ended badly','Not reviewed','3','2021-01-20 02:27:43','2021-01-20 15:25:21',1,1),(64,7,12,3,1,19,'9:09','','Not reviewed','3','2021-01-28 01:28:40','2021-01-28 01:31:15',1,0),(65,5,9,3,6,19,'11:05','','Dive on the inside by #41 when #42 missed the apex. Simple side-by-side door dinging at the exit. Small racing incident','4','2021-01-28 01:31:57','2021-01-28 01:38:17',1,0),(66,22,65,3,6,19,'11:54','','Not reviewed','4','2021-01-28 01:32:52','2021-01-28 01:33:05',1,0),(67,7,39,3,1,19,'12:32','','Not reviewed','3','2021-01-28 01:34:00','2021-01-28 01:34:09',1,0),(68,42,9,3,6,19,'13:24','','Very tricky incident deemed in the end as a racing incident.\nCar #42 takes a defensive line into the corner and oversteers, while car #91 takes the offensive line and bumps off of the kerb, causing a bit of understeer. Both cars come in to contact when side by side at the exit of the corner. ','4','2021-01-28 01:35:26','2021-01-28 01:49:27',1,0),(70,27,9,3,4,19,'15:29','','Not reviewed','3','2021-01-28 01:50:19','2021-01-28 02:08:24',1,0),(71,5,55,3,6,19,'23:34','','Car #6 taps the brakes a bit too early to let #41 pass, #41 doesn\'t anticipate it enough and there is a slight tiny ding as a result.','4','2021-01-28 02:00:28','2021-01-28 02:02:55',1,0),(72,42,55,3,4,19,'26:16','','Warning to both cars:\n- to #91 for not anticipating the slower driver\n- to #6 for lifting to allow for passing in a relatively dangerous place. This will improve with more experience','3','2021-01-28 02:03:53','2021-01-28 02:16:49',1,0),(73,67,65,3,1,19,'35:08','','Car #63 starts accelerating behind #23 at the exit of T2 while #23 had an unbalanced car still. \nWhile #23 was under blue flag, it had only just been waived at him. #63 ends up tapping #23 causing the backmarker to spin. No positions lost.','3','2021-01-28 02:09:23','2021-01-28 02:16:42',1,0),(74,7,55,3,1,19,'40:23','','Car #121 missing his braking point and collides with #6. No positions lost','3','2021-01-28 02:13:32','2021-01-28 02:16:33',1,0),(75,39,55,3,1,19,'57:01','','Car #6 is getting blue flagged. Car #418 moves to overtake on the inside of the esses, but ends up colliding with #6. No positions lost.','3','2021-01-28 02:14:55','2021-01-28 02:16:15',1,0),(76,23,13,3,4,20,'5:16','','Small warning to #88 to leave a little more room when racing side-by-side','5','2021-02-03 22:13:20','2021-02-03 22:14:31',1,0),(77,26,27,3,4,20,'5:20','','Small warning to #97 for the rejoin attempt colliding with #12','5','2021-02-03 22:15:00','2021-02-03 22:16:15',1,0),(79,42,6,3,3,20,'6:45','','A little late on the brakes by #91, ends up colliding with #206 at the corkscrew and causing a chain reaction of collisions.','5','2021-02-03 22:20:46','2021-02-03 22:22:07',1,0),(80,40,0,3,1,20,'12:32','','Although the contact was #156 hitting #136, it was caused by a dangerous braking line immediately after passing by #136. There was no way for #156 to even see the brakes before it was too late.','5','2021-02-03 22:23:43','2021-02-03 22:25:43',1,0),(81,76,9,3,4,20,'1:02:28','','Warning to #404 - Although there was an intent to let the lapping car pass, the delivery wasn\'t ideal (too early and still on the exit of a sharp corner), which caused #42 to collide with #404, and lots of damage to #404 as a result.','5','2021-02-03 22:26:32','2021-02-03 22:32:20',1,0),(82,76,54,3,4,20,'1:03:55','','Warning to #404 - Although there was an intent to let the lapping car pass, the delivery wasn\'t ideal (unexpected behavior at a dangerous fast corner), which caused #669 to collide with #404.','5','2021-02-03 22:29:21','2021-02-03 22:32:16',1,0),(83,54,76,3,1,20,'1:03:55','','Although there was an intent by #404 to let the lapping car pass, and even though the delivery wasn\'t ideal, #669 should be more careful coming up to slower cars at fast corners, and should expect to brake a lot earlier than usual.','5','2021-02-03 22:32:41','2021-02-03 22:34:18',1,0);
